import React from "react";
import "./App.css";
import Card from "../src/pages/Card/Card";
import {
  calendar,
  capture,
  Layout,
  Menu,
  telemetryFactory,
  userRegistryService,
  attendanceRegistryService,
  H4,
  H1,
  H3,
  BodyLarge,
  workHistoryRegistryService,
  schoolRegistryService,
  Loading,
} from "@shiksha/common-lib";
function App() {
  return (
    <div className="App">
      <Layout />
      <Card />
    </div>
  );
}

export default App;
